import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { AdminApprovalComponent } from './admin-approval.component';

const adminApprovalRoute: Routes = [
  {
    path: '',
    component: AdminApprovalComponent,
    data: {
      defaultSort: 'id,asc',
    },
    canActivate: [UserRouteAccessService],
  },
];

@NgModule({
  imports: [RouterModule.forChild(adminApprovalRoute)],
  exports: [RouterModule],
})
export class AdminApprovalRoutingModule {}
